            print('\t\tfp_cswap(&P.z, &S.z, bc);')
            print('\t\tu512_set(&k, primes[actv_ind[i]]);')
            print('\t\txMUL(&S, A, &S, &k);')
            print('\t\tfp_cswap(&P.x, &S.x, bc);')
            print('\t\tfp_cswap(&P.z, &S.z, bc);')
            print('\t}')
