            ptIndices = [_sage_const_0 ]
            last_index = _sage_const_0        # Holds index of last element of pts

            for i, rowV in enumerate(S[::-_sage_const_1 ]):     # We iterate through the strategy, looking at rows of S from bottom to top
                print('\tR = pts[' + str(last_index) + '];')
                start_index = ptIndices[-_sage_const_1 ]
                for ind, x in enumerate(rowV[start_index+_sage_const_1 : len(per)-_sage_const_1 ]):
                    if x == _sage_const_1 :      # Store points for branching nodes
                        ptIndices.append(start_index+_sage_const_1  + ind)
                        k = uint_conv(prod(perm_ls[ptIndices[-_sage_const_2 ]:ptIndices[-_sage_const_1 ]]))
                        s = k[_sage_const_0 ]
                        for j in range(_sage_const_1 ,len(k)):
                            s += ', ' + k[j]
                        print('\t{u512 coef = { .c = {' + s + '}};')
                        print('\txMUL(&R, A, &R, &coef);}')
                        print('\tpts[' + str(last_index+_sage_const_1 ) + '] = R;')
                        last_index += _sage_const_1 
                k = prod(perm_ls[ptIndices[-_sage_const_1 ]:len(perm_ls)-i-_sage_const_1 ])
                if k == _sage_const_1 :
                    last_index -= _sage_const_1 
                    del ptIndices[-_sage_const_1 ]
                else:
                    k = uint_conv(k)
                    s = k[_sage_const_0 ]
                    for j in range(_sage_const_1 ,len(k)):
                        s += ', ' + k[j]
                    print('\t{u512 coef = { .c = {' + s + '}};')
                    print('\txMUL(&R, A, &R, &coef);}')

                print('\tec = lookup(' + str(per[len(per)-i-_sage_const_1 ]) + ', e);')  # Private key value
                print('\tbc = 1 ^ isequal(ec, 0);')                         # Real isogeny needed?
                print('\tx = 2 - 2*(bc && memcmp(&R.z, &fp_0, sizeof(fp))) - (1 ^ (bc || (int)((float)rand()/RAND_MAX * ' + str(ls[per[len(per)-i-_sage_const_1 ]]) + ') == 0 ));')
                print('\tif (x < 2){')
                # x defines type of isogeny to be constructed
                num_pts = sum(rowV)
                print('\t\txISOG(A, pts, ' + str(num_pts) + ', &R, ' + str(ls[per[len(per)-i-_sage_const_1 ]]) + ', x);')
                print('\t\te[' + str(per[len(per)-i-_sage_const_1 ]) + '] = ec - (1 ^ x);')
                print('\t\tcounter[' + str(per[len(per)-i-_sage_const_1 ]) + '] -= 1;')
