            # Build last isogeny
            print('\tR = pts[0];')
            print('\tec = lookup(' + str(per[_sage_const_0 ]) + ', e);')
            print('\tbc = 1 ^ isequal(ec, 0);')
            print('\tx = 2 - 2*(bc && memcmp(&R.z, &fp_0, sizeof(fp))) - (1 ^ (bc || (int)((float)rand()/RAND_MAX * ' + str(ls[per[_sage_const_0 ]]) + ') == 0 ));')
            print('\tif (x < 2){')
            print('\t\tlastxISOG(A, &R, ' + str(ls[per[_sage_const_0 ]]) + ', x);')
            print('\t\te[' + str(per[_sage_const_0 ]) + '] = ec - (1 ^ x);')
            print('\t\tcounter[' + str(per[_sage_const_0 ]) + '] -= 1;')
            print('\t\t(*isog_counter)++;')
